import React from 'react';

const Modal = ({ data, onClose }) => {
  return (
    <div className="modal">
      <div className="modal-contenido">
        <h2>{data.indicador}</h2>
        <p>Descripción: {data.descripcion}</p>
        <p>Categoría: {data.categoria}</p>
        <p>Fecha de Inicio: {data.fecha_inicio}</p>
        <p>Fecha de Terminación: {data.fecha_terminacion}</p>
        <p>Fórmula: {data.formula}</p>
        <p>Frecuencia: {data.frecuencia}</p>
        <p>Área: {data.area}</p>
      </div>
      <button onClick={onClose} className="modal-cerrar">Cerrar</button>
    </div>
  );
};

export default Modal;
